import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#085f80',
    },
    secondary: {
      main: '#19857b',
    },
    background: {
      default: '#161616',
      paper: '#222222',
    },
  },
  typography: {
    fontFamily: "'Poppins', sans-serif",
    h1: {
      fontFamily: "'Fredoka One', cursive",
    },
    h2: {
      fontFamily: "'Fredoka One', cursive",
    },
    h3: {
      fontFamily: "'Fredoka One', cursive",
    },
    h4: {
      fontFamily: "'Fredoka One', cursive",
    },
    h5: {
      fontFamily: "'Fredoka One', cursive",
    },
    h6: {
      fontFamily: "'Fredoka One', cursive",
    },
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 8,
        },
      },
    },
    MuiCard: {
      styleOverrides: {
        root: {
          borderRadius: 12,
        },
      },
    },
  },
});

export default theme;
